	[script]
	id="platform_switch_logic"
		[modification]
		on_process="[
			if(not ('burning_stone_platform_switch_used' in vars.triggered_events),
				set(vars.triggered_events, vars.triggered_events + ['burning_stone_platform_switch_used'])
			),
			if(vars.burning_stone_platform_switch_state = 1, [
				set(platform.vars.move_y1, -256), set(platform.vars.move_y2, 190)
				] where platform = get_object(level, 'toggleable_platform'),
				[
				set(platform.vars.move_y1, -256), set(platform.vars.move_y2, -224)
				] where platform = get_object(level, 'toggleable_platform')
			),
			if(controller_object, remove_object(controller_object))
				where controller_object = get_object(level, 'platform_switch_talk'),
			end_script()
		]"
		target="level.player"
		[/modification]

	[/script]

